import React from 'react';

const Navbar = () => {
  return (
    <div className="navbar"> 
    <nav className="btn-group">
      <div className="logo">
        <img src='/images/logo.png' alt=" Logo" width="102" height="102" />
          <ul className="nav-links">
        <li className="btn-group__item"><a href="#">Home</a></li>
        <li className="btn-group__item"><a href="#">About</a></li>
        <li className="btn-group__item"><a href="#">Contact</a></li>
      </ul>

        <h1 className="btn-group__item">Discover good taste with us</h1>
      </div>

    </nav>
    </div>
  );
};

export default Navbar;
